    '/photos/wine-night/egirls june 2025-101.jpg'
  ];

  useEffect(() => {
    const fullText = 'wine night with the egirls';
    let currentChar = 0;

    const typeInterval = setInterval(() => {
      if (currentChar < fullText.length) {
        setWineNightText(fullText.slice(0, currentChar + 1));
        currentChar++;
      } else {
        clearInterval(typeInterval);
        setIsTyping(false);
      }
    }, 100);

    return () => clearInterval(typeInterval);
  }, []);

  const nextPhoto = () => {
    setCurrentIndex((prev) => (prev + 1) % wineNightPhotos.length);
  };

  const prevPhoto = () => {
    setCurrentIndex((prev) => (prev - 1 + wineNightPhotos.length) % wineNightPhotos.length);
  };

  return (
    <div className="wine-night-page">
      <div className="wine-night-header">
        <div className="macos-window-controls">
          <div className="control red"></div>
          <div className="control yellow"></div>
          <div className="control green"></div>
        </div>
        <div className="macos-title">Wine Night - egirls.faith</div>
