        </div>

        <div className="wine-night-photos">
          <div className="photo-grid">
            {wineNightPhotos.map((photo, index) => (
              <div key={index} className="photo-item">
                <img 
                  src={photo} 
                  alt={`Wine night photo ${index + 1}`}
                  loading="lazy"
                />
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default WineNightPage;
